import React, { useState } from 'react';
import { useAuth } from '../Account/AuthUser';
import '../components/styles/Profile.css';

export default function Profile() {
    const { user } = useAuth();
    const [notificationPermission, setNotificationPermission] = useState(Notification.permission);
    const [showInAppNotify, setShowInAppNotify] = useState(false);

    if (!user) {
        return <div className="profile-container">Not logged in</div>;
    }

    const SERVER_URL = 'http://localhost:5000';
    const avatarSrc = user.avatar ? SERVER_URL + user.avatar : '/default-avatar.png';

    const canPushNotify = user.notification?.push === true;
    const canInAppNotify = user.notification?.inApp === true;

    const missingProfileInfo = !user.age || !user.gender;

    // Показываем уведомление сразу при загрузке, если нужно
    React.useEffect(() => {
        if (canInAppNotify && missingProfileInfo) {
            setShowInAppNotify(true);
        }
    }, [canInAppNotify, missingProfileInfo]);

    const enableNotifications = () => {
        if (!canPushNotify) {
            alert("Push уведомления отключены в настройках пользователя.");
            return;
        }

        if (!("Notification" in window)) {
            alert("Ваш браузер не поддерживает уведомления.");
            return;
        }

        if (Notification.permission === "granted") {
            showNotification();
        } else if (Notification.permission !== "denied") {
            Notification.requestPermission().then(permission => {
                setNotificationPermission(permission);
                if (permission === "granted") {
                    showNotification();
                }
            });
        }
    };

    const showNotification = () => {
        new Notification("Привет!", {
            body: `Добро пожаловать, ${user.username}!`,
            icon: avatarSrc,
        });
    };

    return (
        <div className="profile-container">
            <div className="profile-header">
                <img
                    src={avatarSrc}
                    alt="Avatar"
                    className="profile-avatar"
                    style={{ width: 150, height: 150, borderRadius: '50%', objectFit: 'cover' }}
                />
                <h2>Hi, {user.username}!</h2>
            </div>

            <div className="profile-main-content" style={{ display: 'flex', gap: '30px', alignItems: 'flex-start' }}>
                <div className="profile-info" style={{ flex: 1 }}>
                    <p><strong>Email:</strong> {user.email}</p>
                    <p><strong>Role:</strong> {user.role || 'User'}</p>
                    {user.age !== undefined && <p><strong>Age:</strong> {user.age}</p>}
                    {user.gender !== undefined && <p><strong>Gender:</strong> {user.gender}</p>}

                    {canPushNotify ? (
                        <button onClick={enableNotifications} disabled={notificationPermission === 'granted'} style={{ marginTop: 20 }}>
                            {notificationPermission === 'granted' ? 'Уведомления включены' : 'Включить уведомления'}
                        </button>
                    ) : (
                        <p style={{ marginTop: 20 }}>Push-уведомления отключены в настройках.</p>
                    )}
                </div>

                {showInAppNotify && (
                    <div className="inapp-notification" style={{
                        border: '1px solid #f5a623',
                        backgroundColor: '#fff8e1',
                        padding: 15,
                        borderRadius: 8,
                        maxWidth: 300,
                        position: 'relative'
                    }}>
                        <button
                            onClick={() => setShowInAppNotify(false)}
                            style={{
                                position: 'absolute',
                                top: 5,
                                right: 8,
                                border: 'none',
                                background: 'transparent',
                                fontSize: 18,
                                cursor: 'pointer',
                                color: '#f5a623'
                            }}
                            aria-label="Close notification"
                        >
                            &times;
                        </button>
                        Пожалуйста, заполните свой возраст и пол в настройках профиля для лучшего опыта.
                    </div>
                )}
            </div>
        </div>
    );
}
